import React from "react";

import Button from "../components/Button";

export default function Login() {
  return (
    <div id="login_frame">
      <form method="post" action="login.js">
        <p>
          <label class="label_input">Username</label>
          <input type="text" id="username" class="text_field" />
        </p>
        <p>
          <label class="label_input">Password</label>
          <input type="text" id="password" class="text_field" />
        </p>

        <div id="login_control">
          <Button className={"btn-logIn"} onClick={login}>
            Log in
          </Button>
          <Button className={"btn-signUp"} onClick={toCurrent}>
            Sign up
          </Button>
        </div>
      </form>
    </div>
  );
}

function login() {
  var username = document.getElementById("username");
  var pass = document.getElementById("password");

  if (username.value === "") {
    alert("please input username!");
  } else if (pass.value === "") {
    alert("please input password!");
  } else if (username.value === "gmy" && pass.value === "123456") {
    //window.location.href="welcome.html";
  } else {
    alert("please input correct username and password!");
  }
}

function toCurrent() {
  window.location.href = "https://localhost:3000/SignUp";
}

function toNew() {
  const w = window.open("about:blank");
  w.location.href = "https://r1fsm.csb.app/signup";
}
